//ImportDataset import json format dataset
func ImportDataset(path string) error {
	data, err := ioutil.ReadFile(path)
	if err != nil {
		return err
	}
	err = json.Unmarshal(data, &namedata)
	if err != nil {
		return err
	}
	return nil
}
